	    	<div id="options">
<!-- 				<p>Transition type:</p>
				<input type="radio" name="transition" value="trans" checked> Draw / Move<br>
				<input type="radio" name="transition" value="draw"> Draw / Undraw<br>
 -->				<p>Draw lines:</p>
				<input type="radio" name="drawconsec" value="yes" checked> Consecutive <br>
				<input type="radio" name="drawconsec" value="no"> Simultaneous <br>
				<p>Move lines:</p>
				<input type="radio" name="moveconsec" value="yes" checked> Consecutive <br>
				<input type="radio" name="moveconsec" value="no"> Simultaneous <br>
				<p>Map moving lines by:</p>
				<input type="radio" name="position" value="pos"  onclick="changeOrder('pos');" checked> Position <br>
				<input type="radio" name="position" value="length"  onclick="changeOrder('length');"> Length <br>
				<p>Draw speed: <span id="speedtext">0.5</span></p>
				<input id="drawspeed"  type="range" name="drawspeed" min="0.1" max="1.5" step="0.1" value="0.5" 
   oninput="setDrawSpeed(this.value)" onchange="setDrawSpeed(this.value)">
				<p>Move time: <span id="timetext">600 mS</span></p>
				<input id="movetime" type="range" name="movetime" min="200" max="2000" step="200" value="600" 
   oninput="setMoveTime(this.value)" onchange="setMoveTime(this.value)">
	    	</div>
