<script>

function setDrawSpeed(speed){
	document.getElementById('speedtext').textContent = speed;
}

function setMoveTime(time){
	document.getElementById('timetext').textContent = time + "mS";
}

var svgs = d3.selectAll("#buttonSVGs > svg");
svgs
	.on("click", function(d, i) {
		generateSVG(i);
	})
;


var displaySVG = d3
	.select("#displaySVG")
	.append("svg")
	.attr('id', 'mainSVG')
	.attr('width', '600px')
	.attr('height', '600px')
;

function doSort(target,order){
	var toSort = target.children;
	toSort = Array.prototype.slice.call(toSort, 0);
	console.log(order);

	toSort.sort(function(a, b) {
		if(order=='length'){
		    var aord = a.getTotalLength();
		    var bord = b.getTotalLength();
		    return (bord > aord) ? 1 : -1;
		}else{
		    var aord = a.getBBox().x;
		    var bord = b.getBBox().x;
		    return (aord > bord) ? 1 : -1;
		}
	});

	var parent = target;
	parent.innerHTML = "";

	for(var i = 0, l = toSort.length; i < l; i++) {
	    parent.appendChild(toSort[i]);
	}
}

function changeOrder(order){
	doSort(document.getElementById('mainSVG'),order);
	buttonSVGs = document.getElementById("buttonSVGs").children;
	for (i=0;i<buttonSVGs.length;i++){
		doSort(buttonSVGs[i],order);
	}
}


function generateSVG(svgID){
	paths0 = displaySVG.selectAll("path");
	pathCount1 = svgs.filter(function(d, i) { return i==svgID; }).selectAll("path").size();
	paths1 = svgs.filter(function(d, i) { return i==svgID; }).selectAll("path");
	var delayTally = 0;
	var speed = Number(document.getElementById('drawspeed').value);
	var transitionTime = Number(document.getElementById('movetime').value);
//	var transitionType = document.querySelector('input[name="transition"]:checked').value;
	var drawConsec = document.querySelector('input[name="drawconsec"]:checked').value;
	var moveConsec = document.querySelector('input[name="moveconsec"]:checked').value;
	// if new shape has less paths
	if(paths0.size()>paths1.size()){
		// delete extra lines first
		for(x=paths0.size()-1;x>=0;x--){
			if(x>=paths1.size()){
				// delete path
				paths0.filter(function(d, i) { return i==x; })
					.attr("stroke-dasharray", function(d,i) {
						return this.getTotalLength()+",0";
					})
					.transition()
					.delay(function(d,i) {
						if(drawConsec=="yes"){
							delay = delayTally;
							delayTally+=this.getTotalLength()/speed;
						}else{
							delay = 0;
							delayTally = Math.max(delayTally,this.getTotalLength()/speed);
						}
						return delay;
					})
					.attr("stroke-dasharray", function(d,i) {
						return "0,"+this.getTotalLength();
					})
					.duration(function(d,i) {
						return this.getTotalLength()/speed;
					})
					.remove()
				;
			}else{
				// transform path
				newD = paths1.filter(function(d, i) { return i==x; }).attr("d");
				paths0.filter(function(d, i) { return i==x; }).transition().duration(transitionTime).delay(function(d,i) {
						delay = delayTally;
						if(moveConsec=="yes"){
							delayTally+=transitionTime;
						}
						return delay;
			        }).attrTween("d", pathTween(newD, 4));
			}
		}
	}else{
		for(x=0;x<paths1.size();x++){
			if(x>=paths0.size()){
				// add new path
				newD = paths1.filter(function(d, i) { return i==x; }).attr("d");
				displaySVG
					.append('path')
					.attr('d', newD)
					.attr("stroke-dasharray", function(d,i) {
	          			return "0,"+this.getTotalLength();
	        		})
			        .transition()
			        .delay(function(d,i) {
						if(drawConsec=="yes"){
							delay = delayTally;
							delayTally+=this.getTotalLength()/speed;
						}else{
							delay = delayTally;
						}
			          return delay;
			        })
			        .attr("stroke-dasharray", function(d,i) {
			          return this.getTotalLength()+",0";
			        })
			        .duration(function(d,i) {
			          return this.getTotalLength()/speed;
			        })
				;
			}else{
				// transform path
				newD = paths1.filter(function(d, i) { return i==x; }).attr("d");
				paths0.filter(function(d, i) { return i==x; }).transition().duration(transitionTime).delay(function(d,i) {
						if(moveConsec=="yes"){
							delay = delayTally;
							delayTally+=transitionTime;
						}else{
							delay = 0;
							delayTally=transitionTime;
						}
						return delay;
			        }).attrTween("d", pathTween(newD, 4));
			}
		}
	}
}

var position = document.querySelector('input[name="position"]:checked').value;
changeOrder(position);
generateSVG(0);


/* =========================================
  path tween function by Mike Bostock 
  https://gist.github.com/mbostock/3916621
==========================================*/
function pathTween(d1, precision) {
  return function() {
    var path0 = this,
        path1 = path0.cloneNode(),
        n0 = path0.getTotalLength(),
        n1 = (path1.setAttribute("d", d1), path1).getTotalLength();
 
    // Uniform sampling of distance based on specified precision.
    var distances = [0], i = 0, dt = precision / Math.max(n0, n1);
    while ((i += dt) < 1) distances.push(i);
    distances.push(1);
 
    // Compute point-interpolators at each distance.
    var points = distances.map(function(t) {
      var p0 = path0.getPointAtLength(t * n0),
          p1 = path1.getPointAtLength(t * n1);
      return d3.interpolate([p0.x, p0.y], [p1.x, p1.y]);
    });
 
    return function(t) {
      return t < 1 ? "M" + points.map(function(p) { return p(t); }).join("L") : d1;
    };
  };
}</script>


